<template>
<div class="zhuanpang">
  <link rel="stylesheet" href="/static/CSS/style.css">
  <div class="turntable-bg">
    <div class="turntable" id= "turntable" >
      <img src = "http://nobrokenboy.me/turntable/img/tablePrize.png">
    </div>
    <img class = "pointer" src ="data:image/png;base64,">
  </div>
</div>
